import React, { Fragment } from "react";

// Import components
import ProfilePhoto from "./profilePhoto";

// Import styles
import s from "../../styles/profile.module.css";

const Profile = () => {
  return (
    <Fragment>
      <div className={s.ProfileContainer}>
        <div className={s.ContentLeftWrap}>
          <ProfilePhoto />
        </div>
        <div className={s.ContentLEftWrap}>
          <ProfilePhoto />
        </div>
      </div>
    </Fragment>
  );
};

export default Profile;
